      Name: 'Di Valdes',
      Comment: 'Liliana Towanda Por la manera en que escribes me queda claro que no has leído suficiente sobre el feminismo. A lo mucho, has leído un sólo manifiesto de pasada y decides ignorar por completo el contexto histórico de las ramas existentes.\r\n\r\nMientras que es cierto que la lucha es separatista al momento de señalar como sujeto político a la mujer, en ningún momento se define al estereotipo de mujer en el que se enfoca, ya que ese no es un tema de sociología ni política, si no de filosofía.\r\n\r\nAhora nos vamos al sexo. \r\n\r\nSi supieras más sobre biología, entenderías que el sexo asignado al nacer y registrado en un acta es comúnmente diferente al sexo cromosómico. Ya que, sin incluir los desórdenes existentes debido a variaciones en el gen, existe muchísimo más que sólo el XX y XY que enseñan en niveles básicos de educación con motivos de simplificación.\r\n\r\nFinalmente, hay que entender que, debido a que el contexto en el que la teoría radical se escribió no consideraba existente o válida la disidencia del género binario debido a desinformación y tabú, es necesario como persona que vive en un contexto actual, ampliar y modificar la lucha dependiendo de las necesidades de las mujeres hoy en día.\r\n\r\nDebido a ésto, es adecuado decir que, si no respetas la identidad de una persona trans, e intentas incluir a hombres trans en tu movimiento por y para mujeres, excluyendo a mujeres trans debido a tus prejuicios infundados y desinformados, tu rama no hace más que acallar a un sector de mujeres que tú personalmente consideras inferior o indigno, lo cual no sólo no es feminista, si no que activamente afecta y disminuye la calidad de vida de tus hermanas.',
      'Comment URL': 'https://www.facebook.com/140301286056129/posts/3675981965821359/?comment_id=3681054805314075&reply_comment_id=3681838031902419',
