      Comment: 'Camila Isasi Las mujeres trans son mujeres 🏳️‍⚧️💖. Y tú feminismo no es el único que existe, tampoco puedes elegir quien o no es feminista, eso no es sororo de tu parte. Esto no es un club al que le puedas negar la entrada a quien no consideres tú qué no entra porque es una lucha social.',
