      'Comment ID': '3635901469829409_3636156993137190',
      Name: 'Camila Isasi',
      Comment: 'Violeta Carrera El feminismo es uno. Es la denuncia de la subordinacion del sexo femenino en un sistema de jerarquía por casta de sexo llamada patriarcado.\r\n\r\nQué feminismo defiendes tu, que niega el patriarcado y la subordinacion del sexo femenino al sexo masculino?\r\n\r\nMucha razón, feminismo no es un club de lo que a una mujer le salga del coño. Ni un club de chicas diciendo quien quiere que entre a su invento de neofeminismo. Es un movimiento político con más de 300 años de historia, con sujeto político claro, con teoría y dogma claros. "Si le hace daño al sexo femenino, no es feminismo"\r\nRepito, si tú feminismo no sabe quién es su sujeto político, ni su historia, ni su agenda, quizás es que tú feminismo no es feminismo.\r\nHay muchas herramientas para el activismo feminista segun la etnia, clase social o cultura en que se denuncia la casta sexual, pero feminismo es uno. Para y por la hembra humana.\r\nPuedes ser queer, pero eso no te hace feminista.\r\nEl antirracismo no incluye blancos, el marxismo no incluye burgueses, el antiespecismo no incluye las demandas del torero, el feminismo no incluye al sexo jerárquico que denuncia.\r\nSi no te gusta, puedes tener todo un movimiento con tus denuncias y demandas e inventarse un nombre apropiado según tu sujeto político oprimido a denunciar.\r\nLa categoría política "mujer" y el feminismo, es del sexo femenino, no cambia mientras se siga denunciando el patriarcado.\r\n\r\nSer mujer no es un sentimiento para el feminismo. Es una categoría política subordinada. Identificarse de feminista e ir contra las mujeres es una contradicción política.',
      'Comment URL': 'https://www.facebook.com/140301286056129/posts/3635901469829409/?comment_id=3636156993137190&reply_comment_id=3663586187060937',
