      Name: 'Violeta Carrera',
      Comment: 'Camila Isasi "Si tu feminismo no sabe de su historia, su agenda o su sujeto político, quizás es que tu feminismo no es feminismo", hahaha, sí claro porque las mujeres que no leen, las mujeres que no tienen acceso a Google y a la teoría no pueden ser feministas. Me mandas a leer pero no tienes idea de lo que es género o expresión de género, y por su puesto no tienes ni idea de lo que son las personas trans. Tú que sí tienes acceso a la teoría tal vez podrías escuchar y leer más al respecto, incluso ya que les encanta escudarse en la biología, podrías investigar un poco más y descubrir que no hay solo dos formas biológicas: hombre y mujer.\r\nYa que te encanta justificarte con la teoría (como si lo que no estuviera en la teoría no existiera) ¿quién dice que el feminismo es uno, para y por la hembra humana? No hay una sola autora feminista y ni una sola fundadora. Ni un decálogo del feminismo único.\r\n"Ser mujer no es un sentimiento para el feminismo", en serio, te hace falta escuchar a las personas trans. Ni si quiera sabes que para las personas trans tampoco es un sentimiento...',
