      Name: 'Camila Isasi',
      Comment: 'Violeta Carrera soy médica, profesora de fisiología. Quieres una clase de dimorfismo sexual de especies con reproducion por gametos binarios? Quieres educación en meiosis o alteraciones del dimorfismo sexual en especies mamiferas? \r\nFeminista no es quien se diga feminista, vegano no es quien se diga vegano, marxista no es que se sienta identificado de marxista.\r\nEl feminismo es un movimiento político con más de 300 años de historia que nace de la denuncia de la subordinacion del sexo femenino al sexo masculino en toda sociedad que sea patriarcal.\r\nMuchas autoras, desde su punto de vista, ahondan en ese punto desde su propia redacción política de esa subordinacion. \r\nSi la autora "feminista" no habla de feminismo, las feministas lo consideramos "opinión de pesudofeminismo" o "caballo de Troya". Tal cual como lo hacemos con el "feminismo musulmán" y su defensa de la burka y la Sharia, el "cristiano" y su iglesia misogina, el feminismo "provida" antimujeres, "proxeneta" regulacionista del proxenetismo y el putero, el "capitalista" arrendando mujeres para gestar y parir, "liberal" de lo que me salga del coño es feminismo, el "transfeminista" y su dogma del sexo masculino es más mujer que el sexo femenino, "pro Mutilación genital cultural" y dejen que les corten el clítoris porque es religión....\r\nEn fin, todo lo que hace daño a las mujeres, no es feminista aunque te lo vendan de rosado.\r\n\r\nAsí que para ser feminista, debes saber qué es el feminismo, qué es el patriarcado y cuál es la agenda de las feministas. El feminismo tampoco es un sentimiento. Es un movimiento político. \r\n',
