      Name: 'Camila Isasi',
      Comment: 'Violeta Carrera El feminismo antirracista o de las feministas negras, denuncia la subordinacion del sexo femenino incluso bajo la subordinacion de hombres negros. Subordinadas y oprimidas al doble. Sexo y etnia. El feminismo indígena, denuncia la subordinacion del sexo femenino en sociedades indígenas patriarcales. Son el mismo feminismo en mujeres de toda etnia, clase económica o religión de sociedades patriarcales. Todas son una casta sexual solo por nacer con capacidad reproductiva y sexual de hembra.\r\n\r\nDe qué forma el feminismo trans es la denuncia de la subordinacion del sexo femenino al sexo masculino en un sistema patriarcal con castas en base a sexo? Puede el sexo masculino pasar de opresor a oprimido porque pasó el tiempo? Puede el blanco ser el oprimido en el antirracismo porque va muchos años de movimiento? Se acabó el patriarcado, se acabó el racismo? O solo mutan y se adaptan para seguir iguales?\r\nDe qué forma el feminismo "musulmán" entendido como el feminismo no de feministas musulmanas, si no el que defiende el patriarcado musulmán, ayudaría al sexo femenino?\r\n\r\nQué me creo? Feminista.\r\nY tú? Cómo te defines atacando mujeres por defender la teoría feminista del patriarcado, como castas en base a sexo?',
