      'Facebook User ID': '3658351700878970',
      'Comment ID': '3635901469829409_3636156993137190',
      Name: 'Camila Isasi',
      Comment: 'Violeta Carrera pero cuál es tu militancia política? O tu credo filosófico? \r\nPor qué es ofensivo preguntar eso?\r\nCreo que estamos en generaciones distintas y en políticas distintas. El feminismo no le pertenece al mujerismo. No es lo que a cualquier mujer le salga del coño. Es un movimiento político que le pertenece a toda hembra humana nacida y por nacer. Hace 300 años se tiene un movimiento político estructura y con agenda propia. Hay mujeres en búsqueda de reivindicar la historia feminista desde los inicios de la civilización. Pero como política con estructura, con teoría, tiene cerca de 300 años. Y siempre es lo mismo. La denuncia de subordinacion por nacer hembra.\r\nMi abuela fue a la guerra denunciando que no solo iba a la guerra contra los nazis y franquistas en España, sino porque era hembra. Porque no volvía a ser subordinada de Dios, del Rey ni del marido. \r\nMe parece un insulto que se use como argumento el fascismo y la extrema derecha cuando no sabes la historia de la persona que está conversando contigo. Te pregunto en términos políticos y educativos, porque así aprendo cómo piensas. Pero espero respuesta de ese estilo de una compañera. \r\nUn saludo!',
