      'Comment ID': '3635901469829409_3636156993137190',
      Name: 'Violeta Carrera',
      Comment: 'Camila Isasi No es ofensivo, y nadie está diciendo que lo sea. La diferencia es que tú crees que hay un único feminismo inamovible (europeo) y yo puedo ver que eso no es cierto, hay muchos tipos de feminismo, muchas autoras que critican las posiciones blancas y europeas. Por ejemplo, que había más de dos géneros antes de la colonización y que esa estructura de castas y de dos géneros fue (y sigue siendo) impuesta desde la blanquitud.\r\nLa carta que sacas es lamentable, suena a tengo amigos negros, no puedo ser racista, soy clase obrera cómo voy a ser clasista, tengo hermanas y amigas, ¿cómo te atreves a llamarme machista?, no funciona así. Ese discurso me lo sé de memoria, "¿cómo voy a estar ligada a la derecha? Soy obrera, tengo amigas extranjeras, mi familia es roja", la estructura patriarcal y blanca está tan metida que no se dan cuenta que están del lado del opresor. Ni te cuento la cantidad de feministas blancas españolas que he visto maltratar y oprimir a compañeras musulmanas, indígenas, trans, migrantes. Por eso, hay que escuchar siempre, si yo no soy trans y esas experiencias no me atraviesan voy a escucharlas, si yo no soy musulmana voy a escucharlas a ellas. Si soy blanca, voy a escuchar a otras mujeres racializadas... no voy a teorizar sobre lo que les conviene según yo que nunca he vivido sus experiencias. ¡Saludos!',
      'Comment URL': 'https://www.facebook.com/140301286056129/posts/3635901469829409/?comment_id=3636156993137190&reply_comment_id=3664150130337876',
      'Like Count': '0',
