      'Comment ID': '3635901469829409_3636156993137190',
      Name: 'Camila Isasi',
      Comment: 'Violeta Carrera Te explico mi realidad no para que simpátices, para que empatices. Entiendo los usos de fascismo y extremaderecha porque soy refugiada y víctima de ella. No te cuento del primo gay, soy refugiada política por extrema derecha. Cada quien sabe dónde pone sus simpatías. La mía está con el sexo femenino.\r\n\r\nQué te hace creer que antes de la colonia, la cultura precolombina patriarcal era mejor? Si lo precolonial también tenía un género asignado a quien nacía hembra, y la subordinaba y explotaba sexual y reproductivamente al sexo masculino, y vendía a las hijas? Qué tiene de defensa para temas feministas una camiseta eligiendo un patriarcado? Es romanticismo a lo precolonial o búsqueda de lo decolonial? Lo precolonial será mejor que lo europeo, para indígenas de culturas patriarcales dominantes de otras culturas patriarcales indigenas previas, que terminaron subordinadas a una nueva cultura patriarcal, pero está vez de más lejos. \r\nEl feminismo indígena no reivindicar la lucha de la mujer indígena en su experiencia de hembra y sus propias creencia de liberación patriarcal? No solo se libera de la opresión del colonialista blanco, se libera de la opresión en su propia etnia. \r\n\r\nAún no entiendo quién es tu sujeto de lucha, pero ya creo entender porqué se considera que el feminismo es lo radical, malvado y extremo de denunciar castas sexuales 😒\r\nSaludos! \r\n',
