      'Comment ID': '3631781606908062_3631875100232046',
      Name: 'Fernanda Amador',
      Comment: 'Camila Isasi quién quiere exterminar a quién? \r\n\r\n¿Cómo se manifiesta el borrado de las mujeres? \r\nLa sustitución de la categoría “sexo” por la de “identidad de género”, convierte la definición de mujer en algo completamente subjetivo y que afecta a nuestra realidad material en distintos ámbitos: \r\n👇Abre hilo\r\n🏀🥊🤼‍♀️ DEPORTE \r\nEl campo de juego deja de estar equilibrado en las categorías femeninas en los deportes de competición.\r\n📖 EDUCACIÓN\r\nSe está introduciendo la agenda del transactivismo en los currículums tanto escolares como universitarios.\r\n👭 LESBOFOBIA\r\nLas lesbianas son mujeres cuyas relaciones sexoafectivas se dan únicamente con otras mujeres.\r\n🎠 INFANCIA\r\nSe confunde a la infancia validando la idea de que se puede nacer en el cuerpo equivocado.\r\n📊ESTADÍSTICA \r\nEl análisis objetivo de la realidad deja de basarse en la realidad material para basarse en sentimientos subjetivos.\r\n⚖️ LEGISLACIÓN \r\nSe sustituye la categoría "sexo" por la de identidad de género, con terribles consecuencias para mujeres y niñas.\r\n🌎🗣NEOLENGUA \r\nNo podemos acabar con las desigualdades si desaparecen las palabras que describen nuestra realidad.\r\n🗯ACOSO QUEER\r\nCuando las consecuencias de expresar una opinión son el acoso, se pierde la libertad de expresión.\r\n🩺⚕️SALUD\r\nLa salud de las mujeres pasa a un segundo plano y se pone en peligro la de muchas personas sanas.\r\n🚺 ESPACIOS SEGUROS \r\nSi cualquiera varón tiene vía libre para acceder a los espacios para mujeres, se compromete la seguridad de estas.\r\n\r\nNo al borrado de mujeres.\r\nVía twitter @contraborradoMx',
