      Comment: 'Camila Isasi Respira Cami, que les trans no quieren "tu feminismo". Solo quieren que no se interfiera en la adquisición de sus derechos, como lo están haciendo las Terfs en Puebla o Toluca, queriendo negarles el reconocimiento de su identidad con teorías conspiranóicas de que eso a algo a ellas les afecta o quita algo. Solo quieren una vida libre de acoso y violencia a la que ustedes, con su discurso de odio, contribuyen activamente a poner en peligro, al normalizar los crímines de odio contra las personas trans por las creencias que defienden. Solo quieren tener voz y voto en las decisiones que les afectan, como el aborto. Nadie quiere tu terfminismo, pero ustedes sí quieren marginalizarlos, cuál vil conservador de ultra derecha.',
