      Comment: 'Camila Isasi si, mi amor, a todos ellos se les exige lo que dices. Pero es al revés volteado.\r\nA los blancos se les exige volverse traidores de raza (que implica el desmantelamiento del sistema que los beneficia), al burgués igual. Y en el caso del veganismo es al revés, a quien se nos exige es a los onmivoros, que repensemis la exploración animal y el humanocentrismo.\r\nSi no, pues que ni se metan, pero que no estorben. \r\n\r\nSiguiente pregunta por favor.\r\n\r\nY mínimo lean lo que puso Laurel. Y de pasada los postulados de las luchas que mencionas. \r\n\r\nQuerer seguir uno montado en su macho cuando ahí está cada testimonio de personas trans para ENTENDERLOS es ya una estupidez y necedad intelectual en esta era en qué a un click de distancia ya puedes encontrar a alguien contándole su experiencia al mundo.',
