      Name: 'Camila Isasi',
      Comment: 'Flor Montero Qué nadie quiere borrar al feminismo o las luchas de las mujeres? Estamos discutiendo sobre una nota donde se le exige al feminismo destruirse para incluir a la casta sexual que denuncia de opresora. Insulta a las feministas de malvadas excluyentes por solo ocuparse de la casta sexual oprimida y redefine a la mujer a estereotipos sexistas y constructos patriarcales.\r\nCómo no va a ser reprochable el borrado de las mujeres? Siglos por darle humanidad a la hembra humana, pero ahora es "persona sangrante, menstruante, gestante, lactante"\r\nLey de aborto: lucha historica que costo vidas y años de carcel a las mujeres, en Argentina se borra por "derecho a aborto a personas gestantes" y se reconoce como logro del "transfeminismo". Día de la mujer, día de la niña en ciencias, días de la violencia a la mujer, quienes son los primeros en saltar? Personas de sexo masculino autoidentificada del constructo patriarcal de los femenino, diciendo que la lucha de las mujeres por sus derechos, es SU lucha. \r\nHospitales negando la palabra "madre" o "leche materna" por ser excluyente...\r\nNegar el borrado de las mujeres hasta de sus propios espacios, es absurdo. Lo vemos a diario.',
