      Name: 'Mitzi Hernandez Durán',
      Comment: 'Seguir montados en negar identidades y vivencias es estúpido y una negligencia intelectual en esta era donde es bien fácil contacta con alguien que te cuente sus vivencias.\r\nPermanecer detrás de prejuicios IGNORANTES (al chile, se supone somos relativamente estudiadas pero somos las que más ignorancia sacamos, compañeras) debería darnos un chingo de vergüenza siquiera llamarnos estudiadas. \r\n\r\nSi van a opinar contra la gente trans mínimo vayan y hablen o escuchen sus vivencias y ya ahí siguen con sus mismos chistes y argumentos sumamente PENDEJOS (ay es que se cuelan agresores, pero solapan a violadoras, ajajaja el cuarenta y uno por ciento, pues porque creen pedazo de basuras, desperdicio de carbono que ocurre?por su pinche culero acoso, busquen un pinche pasatiempo más sano, pónganse a hacer scrapbooking, herrería o algo más productivo que acosar raza, aparte que entran sus comportamientos de acoso en ley olimpia), su acoso en redes y que incluso nos dañan y ponen en peligro a muchas mujeres cis, orincopalme que si no entendía en Canones de belleza eurocentricos. \r\n\r\nPaz y pronta deconstrucción. Y ni me vengan a alegar, que ignorantes son por puro pinche pendejo gusto de buscar un enemigo en todos lados. Dejen vivir en paz. \r\n\r\nY ya perdón si me pase pero al chile y la naranja ya me harté de que esciden su ignorancia en supuesta intelectualidad, sus pinches patéticos intentos se defender a las mujeres en violencia y en solapar agresoras, irónicamente.',
