      Name: 'Camila Isasi',
      Comment: 'Emilia López Pérez el feminismo se hace cargo de la opresión en base a sexo. La mujer indígena tiene opresión por etnia como un hombre indigena, pero además, se denuncia en ella una opresión exclusivamente en base a su SEXO.\r\nLa mujer pobre tiene una opresión por clase socieconomica como los hombres pobres, pero otra por SEXO.\r\nEn toda opresión a una mujer, hay una que es solo por su SEXO. Eso es lo que denuncia el feminismo (subordinacion del sexo femenino en toda religión, etnia y clase socioeconomica). Una jerarquía en base a castas por sexos. Cómo sé hace cargo del veganismo o el transactivismo? De qué forma se hace cargo el feminismo de las personas de sexo masculino, si NO TIENEN opresión por casta sexual o capacidad sexual/reproductiva?',
