      'Comment ID': '3631781606908062_3631894696896753',
      Name: 'Mitzi Hernandez Durán',
      Comment: 'Emilia López Pérez Añado, micha de la opresión que viven muchas mujeres no es el sexo la principal, sino cualquier otra.\r\nNo es mi misma opresión como mujer mestiza en este país que la que viven las mujeres indígenas\r\nTampoco es la misma mía como\r\npersona neurodivergente a alguien que no lo es (pero irónicamente tampoco es la misma mía como mujer neurodivergente que la de un hombre neurodivergente y esa es el área donde deberíamos estudiarla). Y en eso debemos trabajar toda la comunidad, en desmantelar esas estructuras o si no no vamos a lograr nada. \r\n\r\nY por supuesto no es igual mi privilegio como persona alfabetizada, en área urbana y cis (las personas trans tienen tasa de asesinatos aún más alta que las mujeres cis, que puede sonar a qué no es mucho consuelo pero... Es algo de margen de supervivencia). Y eso lo tengo que reconocer también. \r\n\r\nPor otro lado respondiendo a Camila nadie borra a nadie. Mi opresión de neurodivergencia, de gorda, de mujer de color, pobre, etc. no borran las de una mujer blanca, neurotipica, hetero.',
