      'Comment ID': '3631781606908062_3631853813567508',
      Name: 'Fernanda Amador',
      Comment: 'Mitzi Hernandez Durán son tan mujeres cómo tú, por qué? Por sus pelos largos y sus faldas? \r\nY no nuestros cerebros no son iguales ni las hormonas que producimos y negar esto es transfóbia y misoginia juntas, mis amigas trans reconocen su transición.\r\nDeja de desinformar y la CONAPRED pues otra institución más en no reconocer que ser mujer no sale del corazón es una realidad biológica material. \r\n\r\nSabe que autores o lecturas leas pero te hace falta echarle mas ganitas como dirías tú. \r\n\r\n“La mayor y más consistente diferencia de sexo en el cerebro se ha encontrado en el hipotálamo, una pequeña estructura que regula la fisiología reproductiva y el comportamiento. Al menos una subdivisión hipotalámica es más grande en roedores y humanos.”\r\n\r\nhttps://theconversation.com/el-cerebro-de-los-hombres-y-las-mujeres-realmente-es-diferente-144257',
