      'Comment ID': '3631781606908062_3631875100232046',
      Name: 'Flor Montero',
      Comment: 'Camila Isasi Relájate. Nadie está pidiendo que se "destruya al feminismo". Solo se está cuestionando actitudes transfóbicas en una corriente feminista. ¿O qué cuestionarse ya dejó de ser parte de la desconstrucción? ¿Nadie se opone a sus derechos? ¿Y qué pedían las manifestaciones de tus compañeras, eh? ¿Vamos a querer tapar el sol con un dedo? Cuestionar tampoco es insultar. Lo que les arde es que les cuestionen su transfobia. Lo que les arde es ver a mujeres trans sobresaliendo por su trabajo, porque quisieran verlas relegadas al trabajo sexual, pobres y marginadas. Con eso ustedes no tienen ningún problema, porque #transfobia. Lo que les arde es que se les diga que siendo la población trans mundial solo un 0.6% del total (ni siquiera llega al 1%), no hay forma de que quiten un lugar a la mitad de la población, menos que las "borren". Lo que les arde es que los hombres trans y las personas no binarias se atrevan a gestar, amamantar, abortar y vestir de rosa o azul sin importar si tienen vagina o pene y no identificarse con su idea rígida de lo que es ser hombre o mujer. ¿Pues no que ustedes están a favor de abolir el género? Lo que les arde es que les digan que aquí ustedes aquí vno están defendiendo nada, más que los prejuicios que comparten con el patriarcado, usando sus mismas tácticas.',
