      Comment: 'Andrea Saldaña No basta con decir que "nadie está negando esos derechos". La lucha radfem en contra de la ley de identidad, la cual da acceso a derechos básicos y fundamentales a las personas trans, es antiderechos. No puedes separarlo, así es. Si las rad están luchando contra una ley que da acceso a otros derechos, entonces sí están negando y obstaculizando derechos, no es difícil de entender.',
