      Comment: '¿Las personas trans merecen los mismos derechos que cualquier otra persona? Sí\r\nPero creo que sí es poco equitativo incluir en competencias deportivas a mujeres trans con mujeres cis género. Finalmente las diferencias biológicas están ahí. \r\nPor otro lado, la prostitución y la renta de alquileres (aunque quieran suavizarlo) son indefendibles, simplemente es seguir viendo el cuerpo de una mujer como un objeto por el cual puedes pagar. \r\nPor último, considero que el llamar a una mujer trans solo "mujer" es borrar esa transición, como si fuera algo malo o que se debe esconder. Pero bueno, ahí es más importante cómo prefieren ser denominadas esas personas.',
