      'Comment ID': '3631781606908062_3631875100232046',
      Name: 'Mitzi Hernandez Durán',
      Comment: 'Mira, te lo dejo de tarea. Están interesantes tus preguntas pero tú solita busca la respuesta.\r\n\r\nPero si quieres la respuesta:\r\n-Es menos probable que un hombre denuncie violencia doméstica o sexual debido a que no lo reconocen o no les creen. \r\n- su índice de suicidios es mayor que el nuestro\r\n\r\nEso es en base al estereotipo de que deben ser siempre fuertes. Mientras no deconstruyan eso (y es tarea suya), pues va a seguir ocurriendo. \r\n\r\nLo trans en realidad es un espectro, btw. Entran personas que se sienten del género opuesto, un poco más para allá, un poco más para acá o ninguno de los dos géneros. Por otro lado me sorprende uses términos coloniales y exluyas de la plática también visiones no binarias del género como las de los pueblos coloniales (o vaya, que tenemos tan integrado el binarismo que si piensas en las abejas, seguro supones que las que no son la reina, las obreras, son hembra y los zánganos son macho, no? Bueno, no es así, son un tercer sexo, por decirlo así). \r\nDigo, ya que te gusta hablar de castas, habrás de saber de las Hijra, a las que el colonialismo británico intentó aniquilar negándoles servicios (te sonará de algo reciente), los encargeló y degradó a criminales solo porque no entraba en su binarismo. \r\n\r\nTodo sistema de opresión tiene mecánicas de las que te puedes beneficiar y otras que te hacen perder ese privilegio. Si quieres entrar a un restaurante caro, obviamente el privilegio es dinero, si no lo tienes, no entras. \r\n\r\nNo es mi obligación educarte en algo que podrías Googlear, por cierto. Busca vivencias de gente trans, busca blogs, películas, habla realmente con una persona trans de su experiencia, tanto una rica como una pobre. Dicen más que estadísticas estériles. Seguro en tu barrio hay alguna persona así. Podré decirte mil palabras bonitas de mis amigos en el espectro trans, pero en tanto tu ni te des la molestia de platicar con uno, pues la neta solo estoy gastando energía emocional en educar a alguien que se niega a ser educada o sentir un poco de empatía por otras personas y reconocer que si, nos beneficiamos también de algunas violencias estructurales. Porque es re culero darte cuenta que eres culera, de modo conciente o no (yo nunca me detuve a pensar que era ableista o racista, por ejemplo y menos que el tener cierto nivel de educación y los beneficios que me da se traducen en violencia simbólica a otros). Pero darse cuenta es el primer paso para ser mejor persona. \r\nÁnimo, puedes ser mejor persona que eso. \r\n\r\nhttp://www.conapred.org.mx/index.php',
      'Comment URL': 'https://www.facebook.com/140301286056129/posts/3631781606908062/?comment_id=3631875100232046&reply_comment_id=3632041433548746',
