      'Comment ID': '3631781606908062_3631875100232046',
      Name: 'Fernanda Amador',
      Comment: 'Mitzi Hernandez Durán “En efecto, entendí que yo no era mujer, era un varón que había cambiado su performatividad de género, aceptarlo fue doloroso, pero si iba a mantenerme coherente con lo aprendido y mis posturas académicas, entonces tenía que aceptar la idea que la definición de mujer era una ‘hembra humana adulta’ a la que se le impone el papel de individuo oprimido debido a su capacidad reproductiva, mediante una serie de normativas sociales y culturales llamadas “feminidad”, algo que yo no era ni había afrontado jamás. En el momento que acepté esto, que entendí esto, la disforia que me llevó a transicionar, simplemente se fue evaporando, acepté mi realidad y mi papel. Por fin tuve paz.\r\n\r\nLo más importante que obtuvé de mis encuentros con el lesbofeminismo (y posteriormente, con el feminismo radical) fue la simple noción que, para entender la realidad de las mujeres y sobre lo femenino, solamente tenía que callarme y escuchar a mujeres, leer a mujeres; me quedaba claro que ni la medicina, ni las artes, ni la política se habían tomado el mínimo esfuerzo de intentar entender o de romper los paradigmas patriarcales y simplemente poner atención a la realidad que la mitad de la población del mundo vive."\r\n\r\nhttps://www.lunaepf.com/2020/09/05/ser-disidente-del-genero-en-la-comunidad-trans/?fbclid=IwAR1AG1sXpk9prRVxmud-Sulx4Qtem45yfFuL5t4pTQRrIvQgIdY_Gxj36dU\r\n',
