      Name: 'Esme Yo',
      Comment: 'Wen V. Stein hay atletas cis que son obligadas a tomar hormonas para reducir las hormonas que les dan una ventaja biológica frente a sus compañeras. Te parece justo eso? Estás mujeres comúnmente son mujeres no-blacas. El argumento biológico tiene las mismas bases que el argumento racista. La "naturaleza" es determinante para la condición humana y su trato, y siempre favorece a un sujete desde la mirada europea de humano. Plis pasemos de esa forma de pensar. Las mujeres trans son mujeres. Habitan la feminidad de maneras que traen a la mesa nuevas formas de entender el ser-mujer y aportan mucho en la lucha contra la opresión sistematica del patriarcado. Excluirlas es un golpe bajo para el propio feminismo. Y no, no "borran" a nadie pero negarlas SÍ BORRAR a muchas mujeres.',
