      'Comment Time': '2/16/21 5:49',
      'Facebook User ID': '3744542995663970',
      'Comment ID': '3631781606908062_3631894696896753',
      Name: 'Mitzi Hernandez Durán',
      Comment: 'Camila Isasi No tomes otras opresiones que tú no vives para justificar tu opresión a otras personas. \r\n\r\nA ti no te mutilaron, no eres prostituta, ni te casaron de niña. Ni a mí, y no por eso voy a usar esa opresion para decir que una mujer trans no pertenece acá. Que sorpresa, ellas tienen más probabilidades de volverse prostitutas que yo, vaya la ironía, al hablar de la prostitución hablaste de ellas también. \r\n\r\nTu reducción del feminismo a realidad biológica cae en la misma opresión y binarismo que\r\ndices querer destruir. \r\n\r\nY DEJA DE USAR CASTA. Pareciera que nomás oíste la palabra y ya la traes para todo. Ni significa eso simbólicamente ni sirve para lo que pretendes. \r\nEsa palabra se usó para motivos RACIALES y por cuestiones de opresión a la gente más pobre, no de género. En ningún, NINGÚN libro de Historia vas a ver "oh sí, la casta femenina". No, vas a ver "la casta de los sacerdotes, de los carniceros, los enterradores, la casta más baja". Es más, checa los sinónimos que ahí están en la captura. \r\n\r\nLas mujeres somos entonces una raza? No, no lo somos. Podemos ser parientes pero entre todas no somos familia y dejar linaje y progenie, no somos un clan. No somos una casta. Ni se de donde sacaste usar esa palabra que ni al caso. \r\n\r\nYa deja de usar casta y de pasada infórmate en feminismo decolonial, donde si podrías usar es palabra fetiche tuya a gusto. Dónde por cierto te vas a topar que muchas ni tienen problema en incluir a los dos espíritus, muxes, Hijra y otras disidencias de género que si, incluyen personas con pene y personas con vagina que no se identifican necesariamente como hombres y mujeres.\r\n\r\nY los derechos no son pastel para que nos toque menos, desde los primeros derechos a ciudadania, voto y seguridad hemos evolucionado los derechos a incluir hasta el arte y la cultura.... y aún si sí fuera pastel el derecho, en mi CASTA, mi clan, mi familia, hemos logrado que medio kilo de pastel ajuste para cien personas y queden todos muy felices y contentos con su paste y nadie dice que se quedó sin.',
      'Comment URL': 'https://www.facebook.com/140301286056129/posts/3631781606908062/?comment_id=3631894696896753&reply_comment_id=3632357740183782',
      'Like Count': '1',
      'Comment Count': '0',
