      Name: 'Emilia López Pérez',
      Comment: 'Sarai Guevara Creo que yo no puedo definir sola lo que es _una mujer_ pues no soy todas ni represento a todas las mujeres. En lo personal, para mí, ser la mujer que soy, es simplemente ser y resistir. Para mí, ser mujer es ser persona, específicamente la persona que soy con mis características físicas y todo lo que me atraviesa, desde mi orientación sexual hasta las violencias a las que he sobrevivido. Pero entiendo que estas características mías no las tienen otras mujeres tal como las tengo yo.',
