      Comment: 'Sarai Guevara Pues qué frágil el feminismo si por una palabra se le cae la lucha, jaja. Lo que yo creo es que somos ambas cosas, somos mujeres y somos personas al mismo tiempo, ¿o dejas de ser una si te nombras con la otra? \r\n\r\nTeóricas como Chimamanda Ngozi dicen que todos, todas deberíamos ser feministas (cito esto aunque ella sea abiertamente transfóbica <|3). Los hombres cis por ejemplo no son sujetos del feminismo, pero acaso los niños varones cis no están siendo educados en ciertas violentas machistas? ¿No deberían ser esos niños, que tienen madres obvia, parte de ese feminismo? Si bien no siendo "sujetos políticos" pero sí parte de esa lucha, tanto como lo son las niñas cis?\r\n\r\nEl feminismo tiene razón de ser en tanto que es una lucha contra un sistema que oprime en este caso a las _personas mujeres_, pero también oprime a las personas negras, y a las indígenas, y a las lesbianas, a las bisexuales y a las mujeres trans. Todas personas. Todas mujeres, cada una con su experiencia de lo que _ser mujer_ representa para ellas.',
