      Comment: 'Cecilia Barona que pena que sientas que debes defender tu feminismo de otres que piden de tu entendimiento y apoyo por sufrir de lo mismo que tú. Discriminación sistematizada por machismo. Es claro que algunas personas necesitan invariablemente discriminar por fallas en su cariño propio, y de respeto y empatía. La inclusión no discrima. El feminismo no discrimina lo femenino. Menstruante o no, gestante o no, lo femenino no se distingue por eso. ¿Que pretenden con tanto odio disfrazado de defensa y protección de algo que no representa ninguna amenaza?? Eso se llama creación de falacias para justificar violencia y abuso. Osea fascismo. Nadie está regresando un milenio para darle derechos a otrx. O.o o.O Al contrario, buscamos ir siempre adelante con eso, lxs que quieren regresar al medievo con sus intolerancias y discriminaciones son quienes escupen discursos de odio y violencia según por qué les vulnera la identidad de otrxs ¿?¿? Mmmmmm hagamos un poco de memoria, recordemos como le llamamos a lo que oprime por pertenecer a una identidad asociada al género femenino... ah si, ya me acordé!! Le llamamos MACHISMO! Y pues sí a algo que quiere parecerse a otra cosa que no es pero lo maquilla echándole ganas le solemos poner el prefijo pseudo. Entonces, con esto de antecedente ¿cómo llamamos a lo que profesan lxs individuos que pretenden identificarse con el feminismo PERO sus verdaderas intenciones son ir en contra de lo que dicho feminismo pretende? Les llamamos pseudofeministas, o falsas feministas. Lo gestante y menstruante no te hace feminista per se. Se trabaja, se concientiza, se aborda y construye él y los feminismos reales. Respetuosos, incluyentes y congruentes.',
