      'Facebook User ID': '3747504788677570',
      'Comment ID': '3631781606908062_3632040123548877',
      Name: 'Vilma Amada Cacho Terron',
      Comment: 'Violeta Carrera tú lo has dicho "muy parecidas", porque al patriarcado no le acomoda que alguien salga de lo preestablecido, y las personas trans se salen de esos límites impuestos por el patriarcado, no por las mujeres. \r\nYo no he negado que las personas trans sufren, pero sufren como nosotras por el género, es decir por lo preestablecido socialmente por los hombres, entonces la abolición del género debe ser el fin común entre el feminismo y el transactivismo, pero no es así por que éste último parece sometido a una serie de teorías que en lugar de abolir al género lo refuerzan. \r\nRespeto a las personas trans, sobre todo me da alegría ver que se unen en favor de la proclama de sus derechos, pero no podemos negar que la opresión de la mujer es por su sexo, porque así nacimos. La lucha feminista a través del tiempo ha ganado el reconocimiento de algunos de nuestros derechos y de espacios para nosotras, para ser vesibilizadas como humanas y como personas, es injusto hasta para la memoria, que abandonemos nuestro propósito y desdibujemos al sujeto político de nuestra lucha para contentillo de otros.\r\nRespeto tu opinión y encuentro puntos concordantes, pero creo que pensamos algo diferente y no está mal, pero creo que por lo menos hoy no estaremos en total de acuerdo. Saludos.',
