      Comment: 'Raquel Reynoso Rodriguez exacto, es importante indagar e intentar entender la postura del feminismo radical: una postura blanca que tiene argumentos racistas. ¿Segura que ya leíste y leíste bien? Pues si, los mismos argumentos que se usaron para discriminar a las mujeres indígenas son los que se usan para excluir a las mujeres trans. Los mismitos. Las compas trans no se sienten mujeres, son mujeres. Reducir la experiencia de vida a un mero órgano (te suena a lo que hicieron los doctores con la virginidad, pfff y se dicen radicales) y luego convertir ese órgano en lo más importante de mi persona sí es borrarme en toda mi experiencia. Pero bueno, ojalá un día vean lo horriblemente racista que es el mal llamado "feminismo radical" (que de radical tiene más mi gato).',
