      'Facebook User ID': '6424639194228800',
      'Comment ID': '3588440867908803_3588846511201572',
      Name: 'Athenas Sánchez Téllez',
      Comment: "Cómo tal no se defiende, ni se aplaude, si nuestros compañeros trans, tanto hombres trans como mujeres trans se ven empujados a replicar estereotipos de género es por supervivencia, y para ser reconocidos en esta sociedad binarista. \r\nLa otra, wey porque se ataca a les compas trans por replicar estereotipos de género pero se les tolera a no sé a las Kardashian o a nosotras mismas, si una morra como tú o yo anda con cabello largo se maquilla y lo presume en su foto de perfil no hay pex, entonces el pedo no es el que se repliquen los estereotipos de género pero quién los replica.\r\n\r\nNext, la apariencia no define quienes somos, define como nos Lee el otro. Si una mujer trans que decide no transicionar y conserva rasgos estereotipicamente masculinos por más que se presente como lo que es, una mujer trans, nosotros, el otro, seguiremos leyendola como vato. \r\nEso es la expresión del género, puede haber una mujer que luzca como vato y esto no lo hace hombre trans, el como luzcas no define tu identidad, un hombre trans que por su entorno no le conviene ejercer su expresión de género y sigue luciendo 'fem' sigue siendo un hombre trans, entonces como podemos identificar entre una mujer que luce masculina y se identifica como mujer y un hombre trans? Preguntándole, escuchando como se expresa de si misme, siendo empáticos.\r\n\r\nLa otra, crecemos en un mundo tan binario que incluso si una morra trans tiene una expresión de género masculina también estaría reproduciendo estereotipos de género ante alguien que la lee superficialmente.\r\n\r\nEn mi ejemplo de fronteras, tomemos a Trump, el wey decía que los del otro lado de la frontera, éramos de un cierto modo, está forma de ser es un estereotipo, si abolimos fronteras alguien de este lado que fue socializado toda su vida con cultura de este lado accede a ese otro sector de poblacion va reproducir el estereotipo cultural que lo diferencia, porque eso es parte de su identidad, igual en un intento de encajar modifica, sustituye o amplia su forma de ser, también reproduciendo ahora estereotipos culturales de el otro lado. Al hacer eso podemos decir que refuerza que aunque no exista la frontera física ahora existe en su identidad. Y si abandona por completo los estereotipos culturales que antes tenía, porque igual eso es lo que quiere y tiene libertad de hacerlo, no faltará quien lo critiqué con algo como: si realmente perteneciera aquí no tendría que haber cambiado.",
