      Name: 'Dinorat Sauceda',
      Comment: 'Ya me iba, pero no quería dejar pasar por alto esto, dicen: \r\n\r\n"Pensar en la identidad de género desde concepciones binarias es racista y colonial". \r\n\r\nIdentificarte como hombre trans u mujer trans (transexual o transgénero) es binario también porque el sexo es un sistema jerárquico que se construye sobre los cuerpos sexuados y esas identidades se construyen con referencia a los dos sexos de la especie, cultural o lo que quieran, pero no presinden de la biología. Identificarte como no binarie, gender fluid, in between, etc, Incluso estaría en oposición a las dos anteriores identidades, hombre T, mujer T. Y honestamente, es bastante ridículo, el género no desaparece primero en la mente, luego en las relaciones sociales y estructuras. Los discursos queer no son ni científicos, no tienen orden interno, son sumamente ideológicos, "cada loco con su tema".',
