      Comment: 'Laura Flores Monroy Con todo respeto. Estás mal. Mi "hipótesis" ni siquiera es hipótesis. En primera te invito a investigar que significa.\r\nEn segunda. La propia OMS ha declarado más riesgoso un parto que un aborto, el cuál puede ir desde sólo medicamento. Un parto en el cuerpo de una menor de edad es considerado de alto riesgo.\r\nLa religión sólo es un impedimento para avanzar como sociedad. Por eso el primer mundo está tan lejos de nosotros, porque por desgracia la gente en Latinoamérica no puede separar sus creencias con su vida. Lo que tú creas no debe de impedir de nadie hacer lo que se quiera con su cuerpo. \r\nY no es "moda", el feminismo es un movimiento que nació desde hace muchas décadas, NUESTRAS ABUELAS NOS HEREDARON EL DIVORCIO, NUESTRAS MADRES EL VOTO Y NOSOTROS DEBEMOS HEREDARLES LA LIBRE ELECCIÓN DE SUS CUERPOS.\r\nEl feminismo NO TIENE COMO CENTRO AL HOMBRE NI AL PATRIARCADO.\r\nUna cosa es que el patriarcado sea sólo una cuna de males, que afecta tanto a hombres como a mujeres, eso de "matar a todos los hombres" es algo que sólo un provida puede decir, pues resalta la poca información de un movimiento que te beneficia a ti, que beneficio a tus ancestras y que seguirá velando por los derechos de todas. Es un movimiento muy complejo y lleno de SORORIDAD. Te invito cordialmente a informarte correctamente sobre los cimientos para que dejes de creer que entre mujeres debemos confrontarnos o que la única forma de acabar con el patriarcado es "matar a todos los hombres".\r\nLas feministas estamos aquí para luchar por los derechos que ya tienes y los que nos hacen falta. Siempre vamos a velar por ti y todas nuestras hermanas. 💚💜',
